import React, { useContext } from 'react'
import { CartContext } from '../../context/context';

const Cart = () => {
  const cartData = useContext(CartContext);
  
  return (
    <div>
      {cartData.items.map((it) => {
        <h1>{it.title}</h1>
      })}
      <img className="py-5" src={require('./carrito.jpg')} alt="No hay tal carrito" />
    </div>
  )
}

export default Cart;
